export default async function predictNextSessionNumberHorses(t,e,r){try{const n=await e.getClientTrimmingInfo(t);if(!n)return 1;let i=await detectTrimmingPattern(n,r);if(!i)return r||1;const s=n?n.trimmings.length%i.length:0;return Math.min(i[s],r)}catch(t){const{default:e}=await import("../../error-messages/errorLogs.js");throw await e("predictNextSessionNumberHorses","Predict Next Session Number Horses: ",t),t}}async function detectTrimmingPattern(t,e){try{if(!t||!t.trimmings)return null;const r=t.trimmings,n=[],i=r.length;for(let t=1;t<=i/2;t++){let e=!0;for(let n=0;n<i;n++)if(r[n].horses.length!==r[n%t].horses.length){e=!1;break}if(e){for(let e=0;e<t;e++)n.push(r[e].horses.length);break}}return 0===n.length&&n.push(e),n.length>0?n:null}catch(t){const{default:e}=await import("../../error-messages/errorLogs.js");throw await e("detectingTrimmingPatternError","Detecting trimming pattern error: ",t),t}}